import React from "react";
import { Box, Grid } from "@material-ui/core";

export default function Users() {
  return (
    <Box className="body-admin bgr-admin">
      <Grid container spacing={1}>
        <Grid item xs={12}>
          <Table>
            <TableHead>
              <TableRow></TableRow>
            </TableHead>
          </Table>
        </Grid>
      </Grid>
    </Box>
  );
}
